  for (let i = array.length - 1; i > 0; i--) {
    let j = Math.floor(Math.random() * (i + 1));
    [array[i], array[j]] = [array[j], array[i]];
  }
  return array;
}


class App extends React.Component {
  state = {
    friends
  };



  render() {
    return (
      <div>
     <NavBar />

     <Wrapper>


        {this.state.friends.map(friend => (
          <FriendCard
            removeFriend={this.removeFriend}
